意新品</strong>作为中国最大的创意电商,我们<span style="line-height:1.5;">抢鲜体验来自全球的海量设计正品。本次携手台湾知名设计品牌</span><span style="line-height:1.5;">BeLuvv，希望将这份有诚意又充满爱的产品引进大陆。</span></p>\r\n<p><span style="line-height:1.5;">本次筹得资金将用于产品的后期优化和量产，并尽早引进大陆，让大陆父母享受到台湾正品的智能产品，并</span><span style="line-height:1.5;">一步步让世界变得更加美好。</span></p>\r\n <h2>我的承诺与回报</h2>\r\n <p>按照预期，我们计划在项目结束后的10天内，向我们的支持者寄出我们的Guardian手环。</p>\r\n<p>我们设置了几个不同的支持档次，具体可见右侧的说明。</p>\r\n<p><strong>友情支持档，</strong>只需支持1元，您可以获得抽取台湾正品追踪儿童智能手环的机会。</p>\r\n<p><strong>第一档</strong>，只需支持198元，您可以享受到<span style="line-height:1.5;">Early Bird的身份，仅限30名。</span><span style="line-height:1.5;">以成本价得到</span><span style="line-height:1.5;">台湾正品追踪儿童智能手环1只。</span></p>\r\n<p><strong style="line-height:1.5;">第二档</strong><span style="line-height:1.5;">，</span><span style="line-height:1.5;">只需</span><span style="line-height:1.5;">支持</span><span style="line-height:1.5;">258</span><span style="line-height:1.5;">元，</span><span style="line-height:1.5;">您仍然可以远低于市场价得到</span><span style="line-height:1.5;">台湾正品追踪儿童智能手环1只</span><span style="line-height:1.5;">。</span></p>\r\n<p><strong style="line-height:1.5;">第三档</strong><span style="line-height:1.5;">，</span><span style="line-height:1.5;">只需</span><span style="line-height:1.5;">支持</span><span style="line-height:1.5;">498</span><span style="line-height:1.5;">元，</span><span style="line-height:1.5;">您将以远低于市场价得到</span><span style="line-height:1.5;">台湾正品追踪儿童智能手环2只，非常适合有两个Baby的家庭。</span></p>\r\n<p><strong style="line-height:1.5;">第四档</strong><span style="line-height:1.5;">，</span><span style="line-height:1.5;">只需</span><span style="line-height:1.5;">支持</span><span style="line-height:1.5;">506</span><span style="line-height:1.5;">元，</span><span style="line-height:1.5;">您将以远低于市场价得到</span><span style="line-height:1.5;">台湾正品追踪儿童智能手环1只+宠物智能追踪器1只。这款为有一个Baby和一只宠物的家庭量身定制。</span></p>\r\n<p><strong>第五档</strong>，<span style="line-height:1.5;">只需</span><span style="line-height:1.5;">支持</span><span style="line-height:1.5;">899</span><s