'Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">"城隍小吃"目标成为家喻户晓的简餐小吃连锁品牌，成为类似于“永和豆浆”一样的连锁餐厅，并给配送中心带来持久收入；</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">"星泰集"目标成为每个城市低端平民版的"鼎泰丰"，且全部直营或者联营，成为可以历史传承的百年老店。在每个城市的中心，提供多元化的餐饮，从点心、面点、砂锅、冷面到干锅、锅仔、炒菜、应有尽有，成为一站式的餐厅。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">“星太吉”&nbsp;将会是未来公司餐饮领域的核心。在有足够资源和能力的情形下，筹建中央厨房，努力发展全配送，可高速发展的"星太吉"。“星太吉”将会将会类似于“真功夫”模式，以中央厨房为核心，高度配送，高度标准化，为人们提供美味可口简餐；</span><br />\r\n<br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105082723816.jpg" style="width:480px;height:240px;" /><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">2、"7LUNCH"吃饭去网，目标成为全国最大最专业的餐厅菜单展示、点评、外卖、预定、网络营销平台，同时为商家和用户提供大量免费的菜谱；并和微信餐饮公众号平台“吃饭去”，以及吃饭去APP相结合，颠覆目前的团购和外卖O2O模式，线上成为餐饮界的"淘宝"，在线下成为软硬件供应商和食材供应商，并为非商户用户提供最好的饮食方案。</span><br />\r\n<br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105082755488.jpg" style="width:480px;height:324px;" />', '<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">1、线下实体连锁餐厅，“城隍小吃”以连锁加盟发展为主，“星泰集”以直营、联营发展为主，两者共同最大化的获取现金回报的经营利润，以支持公司的不断投入和股东未来的分红。</span><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">“杨土狗”&nbsp;为公司新注册食品类商标，未来在公司店面足够多的情形下，依托店铺数量以及吃饭去&nbsp;APP的优势，展开&nbsp;酱菜、坚果零食类的研发生产和销售。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">“北落师门”&nbsp;为公司已经拥有的食品商标，未来亦会依附公司渠道，研究发展速冻食品、食品半成品、调味酱等领域。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">“星泰集”“城隍小吃”为公司餐饮店面商标；主要用于餐厅连锁。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105082530739.jpg" style="width:480px;height:360px;" /><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">2、"7LUNCH"&nbsp;在为餐饮商家和顾客提供免费网络营销、网络菜单、外卖、订座、点评服务的同时，会向商家提供收银系统和外送系统的软硬件服务，并将收银和外送系统与7LUNCH平台和APP实现连接；未来的7lunch将会成为一个真正可以链接餐厅和客户的工具，为有效的为餐饮商家带来帮助。</span><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">我们在早期的框架搭建完成后，会寻求专业的互联网领域的伙伴一同发展；我们提供餐饮行业的专业知识、需求、实际产品并不断反馈真实数据，由更加专业的人负责技术、营运、开发以及用户体验等领域；早期我们将会以实体店的收入来补贴7lunch项目的营运，同时提供该项目的有吸引力的期权以吸引最好的伙伴加入以降低早期的现金投入，未来我们将会将该项目独立发展。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">微信平台：&nbsp;我们为商家提供微信餐饮的营销，以一个大公众号以及餐厅独立订阅号为连接，&nbsp;餐饮用户可以在微信上实现餐厅菜单浏览、外卖，订餐等功能；（目前仅能实现附近餐厅的搜索功能）</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">微信平台公众号：&nbsp;吃饭去</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105082951520.jpg" style="width:640px;height:380px;" /><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105083021973.png" style="width:412px;height:194px;" /><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">吃饭去&nbsp;APP：我们将会将网站的功能在APP上实现，为广大用户提供搜索餐厅并翻看菜单、分享美食图片、拍摄食品的美化图片、搜寻热点、分享菜谱，浏览最新菜谱、并向用户提供部分菜谱的原材料；</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">吃饭去APP：&nbsp;&nbsp;正在开发中&gt;&gt;&gt;&gt;&gt;&gt;</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">网络餐厅菜单（可提供独立二级域名）&nbsp;外卖&nbsp;&nbsp;订座&nbsp;&nbsp;点评</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105083110643.jpg" style="width:640px;height:446px;" /><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">每一个独立二级域名和微信公众号，都属于餐饮商家自己所有；</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">商家可以向属于自己的客人宣传自己的网址以及微信订阅号和APP小店；</span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105083152799.jpg" style="width:493px;height:31px;" /><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">菜谱以及分享（未来我们将会在手机客户端，向所有用户免费提供菜谱服务并以此为切入点，形成小众的菜品分享SNS平台，以及可以直供定制原材料的saas平台）</span><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105083222989.jpg" style="width:640px;height:418px;" /><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;"></span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105083258818.jpg" style="width:640px;height:415px;" /><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">公司IT部门未来专注于：&nbsp;APP的开发&nbsp;&nbsp;收银点餐系统&nbsp;&nbsp;外卖系统&nbsp;&nbsp;菜谱半成品及原材料</span>', '<span style="color:#0099FF;font-family:''Microsoft YaHei'';font-size:18px;line-height:40px;background-color:#FFFFFF;">项目赢利模式说明</span>', '', '', '<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">1、丰富的餐饮经验以及成熟的连锁体系，并拥有一定的知名度；同时，我们与上海著名快餐饮品牌“豫申园”战略合作，互相参股店面共同开发上海市场；</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">2、对餐饮市场的边际需求痛点，有精准的认识和理解。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">3、我们的地域销售团队，可以同时负责餐饮店面开发、网站平台推广、微信餐厅平台推广、收银系统销售与维护、原材料或商品的销售及配送等多项业务的交叉销售，拥有其他公司不可比拟的效率和收益；同时，我们可以就公司业务，展开与餐饮结合的城市代理。</span><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">附： 实体店&nbsp;与&nbsp;网络&nbsp;的结合互补：</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">1)&nbsp;&nbsp;我们在加盟连锁领域的经验，会帮助我们最快的找到各个城市的代理商；&nbsp;这些代理商，将会有助于我们推广7lunch&nbsp;的平台以及微信平台；</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">2）我们7lunch平台（网站、微信平台、APP），同样会为公司第一时间寻找到适合餐饮的店面；</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">3）未来的中央厨房和食品厂，将会生产合适的产品（调味品类），可以通过餐饮流通渠道以及网络&nbsp;APP渠道进行生产；</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">4）APP&nbsp;的菜谱功能，我们在提供各种菜谱的同时，亦会根据自身的产品（杨土狗），研发最新的菜单，并向用户提供核心调料。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">5）我们的未来的收银体系和APP体系，将是捆绑这一切的基础，两者结合互补，将提高用户的黏性。</span>', 'a:2:{i:0;a:7:{s:4:"name";s:12:"连山投资";s:3:"job";s:9:"投资人";s:12:"is_full_time";s:3:"是";s:5:"share";d:15;s:12:"invest_money";s:0:"";s:8:"relation";s:0:"";s:8:"describe";s:283:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:medium;line-height:33px;background-color:#FFFFFF;">连山天使投资；法人（领投人）为潘祖强，拥有丰富的金融和资本经验，与其他众多股东一同给了公司很多指导。</span>";}i:1;a:7:{s:4:"name";s:6:"杨安";s:3:"job";s:9:"创始人";s:12:"is_full_time";s:3:"是";s:5:"share";d:85;s:12:"invest_money";s:0:"";s:8:"relation";s:0:"";s:8:"describe";s:681:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">杨安（创始人，擅长定位和规划）：海洋大学毕业，其后在上海众多五星级及顶级餐厅供职；05~09独立筹备运营咖啡厅；期间，同时参与“豫申园”的筹建创立，如今的“豫申园”为上海著名餐饮品牌，拥有超过40家的直营以及加盟店；10年起筹建创立“城隍小吃”“星泰集”等品牌，13年盲目冒进导致公司出现重大问题，14年获得一笔众筹资金重新开始；&nbsp;人生目标将永远致力于“将最好的餐饮带给身边的人”。</span>";}}', 'a:2:{i:0;a:5:{s:4:"name";s:9:"单可军";s:3:"job";s:6:"总厨";s:12:"is_full_time";s:3:"是";s:8:"relation";s:0:"";s:8:"describe";s:379:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">单可军（总厨，擅长菜品开发、厨房管理）：原彩虹坊、天目山农庄等知名餐饮的行政总厨；12年加入团队；&nbsp;现为&nbsp;“星煌餐饮”行政总厨，专注于厨房建设管理、菜品研发等工作；</span>";}i:1;a:5:{s:4:"name";s:9:"赵文建";s:3:"job";s:12:"区域经理";s:12:"is_full_time";s:3:"是";s:8:"relation";s:0:"";s:8:"describe";s:444:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">赵文建（区域经理，擅长管理、培训）：多年上海传统点心店运营经验，负责店面营运督导以及物流，店面筹备培训管理；自从08年起，参与了“豫申园”的创立筹建，10年起，一直专心的在星煌餐饮，参与创立”城隍小吃”“星泰集”。</span>";}}', 'a:1:{i:0;a:2:{s:4:"info";a:11:{s:4:"name";s:12:"第一阶段";s:10:"begin_time";s:8:"2014-6-1";s:8:"end_time";s:8:"2015-2-2";s:8:"describe";s:857:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">我们在14年六月份获得100万的小额投资，顺利度过之前因为盲目冒进带来的困境（当时过于追求扩张，盲目投资筹建了中央厨房；并且错误的预估了自身的发展速度，导致中央厨房的亏损拖垮了盈利的实体店），并在半年内完成了之前的年度目标，即重新开设联营了三家餐厅，并系统化了加盟连锁业务，完成了"&nbsp;7LUNCH"吃饭去网的前期框架搭构调试，并且保持公司在扣除投资成本后，每月营运处于盈利状况且账面拥有60万以上的现金。同时我们以不低于投资时的估值，回购了部分投资人的股权，帮助部分投资人实现了财务退出并保持良好关系。</span>";s:11:"do_describe";s:1398:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">大学路店：&nbsp;每月流水超过80万，每年营业额流水超过1000万；<br />\r\n净利润在10~15万每月；<br />\r\n公司占有10%的股份；</span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105091658200.jpg" style="width:640px;height:175px;" /><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">宝山店&nbsp;&nbsp;：&nbsp;每月流水超过40万，每年营业额超过500万；<br />\r\n净利润在5~8万；<br />\r\n公司占有40%的股份；</span><br />\r\n<img alt="" src="http://www.dajiatou.com/uploadfile/2015/0105/20150105091807410.jpg" style="width:640px;height:175px;" /><br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">莘庄店：&nbsp;&nbsp;&nbsp;筹备中，尚未开业；<br />\r\n公司占有30%的股份；<br />\r\n出于资金的缺乏以及对风险的把控，因此所有店面，我们都采取了合作联营的方式；以降低成本和风险；凭借过往餐饮定位和管理经验以及行业内的口碑，很多圈内伙伴愿意资源互补的进行合作，以及部分加盟商愿意将店面委托管理。</span>";s:9:"is_income";s:1:"1";s:11:"item_income";s:1:"0";s:6:"is_out";s:1:"1";s:8:"item_out";s:5:"13150";s:10:"income_num";i:1;s:7:"out_num";i:2;}s:3:"out";a:1:{i:1;a:3:{s:4:"type";s:25:"公司营运&商标费用";s:5:"money";s:5:"13150";s:4:"memo";s:66:"7lunch开发、美工；印花税；商标（杨土狗）注册等";}}}}', 'a:1:{i:0;a:1:{s:4:"info";a:11:{s:4:"name";s:12:"第一阶段";s:10:"begin_time";s:8:"2015-3-1";s:8:"end_time";s:9:"2015-6-17";s:8:"describe";s:1903:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">1、自营或者联营8家以上的豫申园或星泰集餐厅，获得稳定的收益，以支持公司其他业务的投入。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">2、筹备开设十五家以上的"城隍小吃"加盟店，更好的完善加盟和配送体系，并为未来直营店的高速发展获得物流配送的体系和经验。同时，积极发展外地省份的加盟商，培训他们负责7lunch&nbsp;以及相关平台的推广。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">3、完成收银软硬件的代理和开发，并让7LUNCH的销售和地推团队，覆盖上海的所有商圈。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">4、完成“吃饭去”APP的开发和完善，并让产品成为人们寻找餐厅、寻找菜谱、分享美食的助手。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">5、在第三项完成后，启动外卖软硬件系统的研发工作，并接驳7LUNCH主网站，颠覆目前的外送市场。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">6、完成A轮融资的筹备工作。</span><br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">我们相信，一年后我们会成为一家价值5000万美金的创业公司，并建立起行业壁垒的雏形。</span>";s:11:"do_describe";s:1182:"<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">1、等待时机开设更多的"星泰集"直营店<br />\r\n2、完善"城隍小吃"的加盟体系和培训体系，并重新建立小型的配送中心。<br />\r\n3、建立规范的公司体系。<br />\r\n4、完成"7LUNCH"团队的搭建以及上海市场的推广，并不断完善网站以及&nbsp;APP的用户体验。<br />\r\n5、启动收银硬件的代理销售以及自身的软件研发，并获得其他一定的市场占有率和利润。<br />\r\n6、寻找或研发出可以面向餐饮商家服务以及顾客的直供食材产品线。</span><br />\r\n<br />\r\n<br />\r\n<span style="color:#333333;font-family:''Microsoft Yahei'', SimHei;font-size:16px;line-height:33px;background-color:#FFFFFF;">详细未来预估收入，牵涉到公司敏感规划和数据；请与项目负责人直接联系咨询；<br />\r\n<span style="line-height:25px;background-color:#F7F7F7;">咨询QQ:14425509&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;咨询微信：yangan42492 <br />\r\n联系电话： &nbsp;13661995177 &nbsp; &nbsp; 邮箱： &nbsp;eric.yang@cheerfood.com</span></span>";s:9:"is_income";s:1:"0";s:11:"item_income";s:1:"0";s:6:"is_out";s:1:"0";s:8:"item_out";s:1:"0";s:10:"income_num";i:1;s:7:"out_num";i:1;}}}', 'a:0:{}', 0, 2, 1388476800, 45, 1, 1, '上海星煌餐饮管理有限公司', '上海市宝山区聚丰园路362号', 0, 0, '我们目前的核心业务分为两块：一块是线下实体连锁餐厅，以"城隍小吃"和"星泰集"这两个品牌为核心，加盟与直营共同发展的餐饮连锁项目；未来将会在自己店面的基础上，拓展其他模式的餐饮品牌，如“申旺兴”“吴胖子”等，研发合适的食品半成品、调味品以及干货；一块是以"7LUNCH"为核心的互联网以及移动互联网 O2O 项目，为餐饮商家免费提供外卖、订座、网络营销（微信餐厅、独立app)、点评等服务，并以此为切入点，未来为餐饮商户和直接顾客，提供收银系统以及外卖系统的软硬件服务，以及直接的原材料和食材的电子商务服务。咨询QQ:14425509 咨询微信：yangan424929 投资交流QQ群42878034', 1435456071, 1, 0.00, 40.00, 0, 0.00, 2, 0, 820000.00, 4, 10000.00, '', 'a:7:{s:8:"legal_id";a:2:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";}s:12:"legal_credit";a:2:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";}s:16:"business_license";a:2:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";}s:28:"tax_registration_certificate";a:2:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";}s:17:"organization_code";a:2:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";}s:13:"company_photo";a:2:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";}s:13:"site_contract";a:2:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";}}', 0),
