(268, '1元团-互联网众筹新模式', 'ux27169ux24335,ux20114ux32852ux32593,ux49ux20803ux22242ux45ux20114ux32852ux32593ux20247ux31609ux26032ux27169ux24335', '模式,互联网,1元团-互联网众筹新模式', './public/attachment/201501/27/09/4137bd223137c2a36cba77b3c1a2b02894.jpg', '', '', 0, 1395857910, 1435342719, 1, 2000000.00, '', '', 0, 1, 1, 229, 0, 100000.00, 90000.00, 0.00, 1422935104, '', '', '', '商品众筹', 'ux21830ux21697ux20247ux31609', '商品众筹', 1425489887, 1, 5, '北京', '昌平区', 17, 5, 'fanwe', 1, 0, 0, '', 0, '', 0, 0, 1, 0.00, '', 0, '', '', 1, '<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">本项目的目标受众群体为19-45岁学生及工薪阶层，主要集中于在校学生及工薪阶层为主要开发客户群体核心。年龄段为19-45岁。通过数据调研我们得知，正是这部分群体组建了我国网民大军，占比达到了55.1%。而学历越高理性消费意识越重反之则冲动消费越高，调查数据得知初中至技校学历在网民中占比最高，达67.2%。预计未来5年，受众人群最高年龄去到50岁。</span><br />\r\n<br />\r\n<img style="width:802px;height:460px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1220/20141220052827935.png" />', '<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">1元团的意义在于让所有商品都变得平易近人，商品价格种类从小至几十元大至几十万元，小至移动电源、手机等，大至汽车、房地产，推翻传统电商全额购买方式，1元团将消费门槛降到最低，简单易用的PC和APP轻松体验网购乐趣,众筹网购模式能满足目前年轻消费者的购物需求。</span><br />\r\n<br />\r\n<img style="width:800px;height:460px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1210/20141210030532817.jpg" />', '<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">随着互联网与网络购物的兴起与迅速发展，给各位消费者带来了前所未有的便利。品类丰富的各类商品不断地充斥着我们的眼球，不断的吸引着我们的欲望;眼花缭乱的商品在通货膨胀的今天让许多消费者不断的建立“理性消费”观念，经济条件的制约让消费者们一次又一次的忍痛割爱，“鱼与熊掌难以兼得”让很多消费者在体验购物的过程中也尝受着无奈的痛苦。为此1元团（www.1ytuan.com）应运而生，1元团使用非常独特网购模式——“众筹”，只需1元就有可能买到一件心仪的商品。本项目利用众筹为核心概念进行运营，而同时也在众筹模式上进行升级。采用全新的互联网商品众筹销售方式,</span><span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#ff0000;font-size:16px;">1元团把一件商品按市场价格平分成若干“等份”出售，每份1元，每1元为一个随机团码，当一件商品所有“等份”售出后，根据第三方股市数据，计算出一名幸运团码，拥有该幸运团码的消费者即可获得此商品。</span><br />\r\n<br />\r\n<img style="width:802px;height:471px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1220/20141220060023300.png" /><br />\r\n<br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">1元团揭晓模式：</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">①揭晓日收盘时的上证指数× 收盘时的深证成指 × 10000 = 12位数。（指数以证交所公布数字为准）；</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">②将此12位数的数字，除以商品总需参与份数，得到的余数加10000001即为本次活动的最终“幸运团码”。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">例如</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2014-12-29收盘时的上证指数是 3168.02，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2014-12-29收盘时的深证成指是 10780.40，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">将这两个数字相乘后再乘以10000得到的12位数为341525228080。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">如果这个商品是 iPhone6, 商品份数为5988，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">以341525228080整除以5988，商为57034941，余数为1372，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">用1372+10000001=10001373，即“幸运团码”为：10001373。</span><br />\r\n<br />\r\n<br />\r\n<img style="width:797px;height:481px;" alt="" src="http://www.dajiatou.com/uploadfile/2015/0120/20150120021915873.png" />', '<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">A、所发布的商品来货价和发布价之间的利润；</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">B、网站将提供“品牌街”栏目，当消费者获得商品后，可选择以折扣价将商品转到品牌街出让，网站收取转让佣金。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">C、回款周期：从众筹到成团揭晓，当天单个商品、当日本站多个商品分别成团，揭晓后消费者确认邮寄地址至发货周期为3个工作日，按股市休市及节假日顺延，增加1天的资金回款期，则可得出总资金回款期至少7天以上。这为下一步互联网金融模式打下坚实基础。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">（回款周期是指：出售商品等待确认款项到账时间）</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">D、本模式除了降低用户的消费门槛，同时可通过商品众筹过程中，碎片营销的数据实现庞大的广告效应，实现广告营收。</span><br />\r\n<br />\r\n<img style="width:803px;height:450px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1220/20141220053434991.png" />', '<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">目前为止同类网站仅有一个，为深圳的“1元云购www.1yyg.com”，该网站目前交易额突破2亿，其他类似网站不多。1元团团队有着丰富互联网运营经验，独特的运营模式，致力走在同行业第一位。</span><br />\r\n<br />\r\n<img style="width:814px;height:460px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1220/20141220053000887.png" />', '<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">1、针对1元云购www.1yyg.com，他们采用的揭晓方式为服务器最后100条交易记录之和除商品总份数，然后取余数为结果，1元团采用股市收市得出指数计算结果，从模式上，我们的计算方式更加公平公正。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2、1元团独立设定了品牌街栏目，消费者获得商品后，如不需要可以放到品牌街上出售，增加了消费者的购买欲。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">3、推翻传统电商单一线上推广方式，结合线下推动线上，有效利用线下资源整合，充分利用人与人之间的信任进行合理推广，团队负责人有着丰富线下运营推广策划经验。</span><span style="line-height:30px;background-color:#ffffff;font-family:''Microsoft YaHei'';color:#555555;font-size:14px;"></span> \r\n<div style="background-color:#ffffff;margin:0px;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">\r\n  4、1元团有包含PC、wap、andorid、ios等移动应用终端，处于同行领先水平，目前IOS版成为此模式进驻APP Store的先驱者，抢先占领移动互联网的先驱市场。<br />\r\n5、后台设立强大的市场数据分析系统，可针对用户性别、年龄、消费水平、消费周期、用户地区分布等利用大数据分析模式，针对使用习惯留住以加入用户，刺激消费；利用数据分析有效进行精准的市场推广及营销。<br />\r\n<img style="width:800px;height:453px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1220/20141220053044205.png" /> \r\n</div>', 'a:2:{i:0;a:7:{s:4:"name";s:10:"葛苏丹 ";s:3:"job";s:12:"副总经理";s:12:"is_full_time";s:3:"是";s:5:"share";d:40;s:12:"invest_money";s:2:"40";s:8:"relation";s:0:"";s:8:"describe";s:1380:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">葛苏丹，女，1986年7月出生，“1元团”联合创始人</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">毕业于北京师范大学国际传媒设计学院，接触互联网行业8年，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">对互联网行业的发展有深刻理解，对用户体验、交互设计有着坚实的基础</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2011年联合创办茂名景森网络通讯科技有限公司任命副总经理</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2012年负责公司旗下品牌团购网“A+商城”的PC、andorid等UI设计总监</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2014年负责公司旗下品牌“1元团”的PC、wap、andorid、ios等UI设计。独特的设计风格是平台收到广大网民的青睐。</span>";}i:1;a:7:{s:4:"name";s:10:"梅景森 ";s:3:"job";s:9:"总经理";s:12:"is_full_time";s:3:"是";s:5:"share";d:60;s:12:"invest_money";s:2:"60";s:8:"relation";s:0:"";s:8:"describe";s:1670:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">梅景森，男，1983年8月出生，“1元团”创始人</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">毕业于广东省广播电视大学，接触、关注联网行业16年</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">对互联网行业的发展有深刻理解，具有丰富的行业实践经验</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2011年投资创办茂名景森网络通讯科技有限公司任总经理</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2012年创立了品牌团购网“A+商城”推出，期间参与管理平台开发、运营等全面工作，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">有效地进行资源整合，合理分析用户需求，项目运营以来，受到政府和网民的充分认可。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2014年创立了“1元团”，以多年的电商行业运营及实践经验，深耕用户需求，充分整合线上线下资源，开拓了具有巨大商业价值的生态平台“1元团”</span>";}}', 'a:3:{i:0;a:5:{s:4:"name";s:10:"黄汉挺 ";s:3:"job";s:15:"前端工程师";s:12:"is_full_time";s:3:"是";s:8:"relation";s:12:"朋友推荐";s:8:"describe";s:1155:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">黄汉庭，男，1989年出生，毕业于广东科技大学，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">曾参与多家商城平台开发、财务系统开发、数据采集托管平台建设、广告联盟平台建设等。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">热衷于互联网技术，具备丰富的WEB前后端开发经验，熟悉各类CMS及商城系统的架构与开发。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2013年加入景森网络，参与公司旗下品牌团购网“A+商城”的系统开发工作，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2014年担任“1元团”开发部项目前端制作工程师。</span>";}i:1;a:5:{s:4:"name";s:9:"冯华辉";s:3:"job";s:12:"市场运营";s:12:"is_full_time";s:3:"是";s:8:"relation";s:12:"朋友推荐";s:8:"describe";s:1255:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2007年9月到2010年6月 毕业于广东石油化工学院，市场营销专业</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2010年6月到2011年5月 就职于上海征途信息技术有限公司,市场拓展</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2011年5月到2011年10月 北京窝窝团信息技术有限公司，市场企划</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2011年11月到2013年3月 东风日产茂名广利专营店，数字营销主管</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2013年3月加入公司旗下团购网的市场调研工作，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2014年担任1元团市场运营总监。</span>";}i:2;a:5:{s:4:"name";s:9:"李飞强";s:3:"job";s:15:"开发部总监";s:12:"is_full_time";s:3:"是";s:8:"relation";s:6:"朋友";s:8:"describe";s:1639:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">李飞强，男，1984年出生，毕业于都广东省高州农校计算机应用，接触互联网16年，并在互联网行业工作多年，于2003年已取得Microsoft&nbsp;Certified&nbsp;Professional（微软认证产品专家）Microsoft&nbsp;Certified&nbsp;Systems&nbsp;Administrator（微软认证系统管理员）</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">曾工作于华硕电脑市场部，有创业理想，有七年创业经验，拥有项目整体规划，市场营销，统筹运营经验，善于学习对市场触觉敏锐能快速地抓住市场商机。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">曾合伙创业与电信联通合作建立电信IDC数据业务并负责运营工作，于2009年送宝网（</span><a href="http://www.sonbao.com/">www.sonbao.com</a><span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">）项目立项任项目总监，在这过程中接触到项目管理各方面的因素与执行需求，能很好与团队及第三方协调合作。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">鉴于与创始人目标人生价值使命一致，于2014年加入公司，负责1元团技术开发团队管理工作</span>";}}', 'a:1:{i:0;a:2:{s:4:"info";a:11:{s:4:"name";s:48:"网站建设、市场目标和营销策略制定";s:10:"begin_time";s:9:"2014-4-10";s:8:"end_time";s:10:"2014-12-24";s:8:"describe";s:1397:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">本项目自2014年3月份启动，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">截止到12月，已经完成PC、wap、andorid、ios等移动应用终端开发，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">初步完成了市场分析系统的开发已经投入使用，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">同时制定了市场目标及良好的营销策略。</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">目前网站注册会员突12714人，网上交易额81.76万。</span><br />\r\n<br />\r\n<img style="width:800px;height:460px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1210/20141210042749926.jpg" /><br />\r\n<br />\r\n<img style="width:804px;height:459px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1210/20141210042816912.png" /><br />\r\n<br />\r\n<img style="width:800px;height:460px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1210/20141210042856278.png" />";s:11:"do_describe";s:1142:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">由于项目创始人有着丰富的互联网企业运营经验，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">在项目研发的过程中，</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">1、严格落实项目进度；</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2、严格把控各个部门的工作职责；</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">3、对每个部门的工作绩效进行严格的管理；</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">4、结合强大的数据分析系统，对市场需求制定合理的营销方案。</span>";s:9:"is_income";s:1:"0";s:11:"item_income";s:1:"0";s:6:"is_out";s:1:"1";s:8:"item_out";s:5:"31731";s:10:"income_num";i:1;s:7:"out_num";i:2;}s:3:"out";a:1:{i:1;a:3:{s:4:"type";s:18:"水电费及杂项";s:5:"money";s:5:"31731";s:4:"memo";s:46:"以上开支统计为2014年3月1日-12月1日";}}}}', 'a:1:{i:0;a:3:{s:4:"info";a:11:{s:4:"name";s:39:"商品种类拓展及市场营销拓展";s:10:"begin_time";s:8:"2015-1-2";s:8:"end_time";s:9:"2016-1-23";s:8:"describe";s:922:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">1、实现商品品类多元化，主要以中高端品牌商品为主，有流量，有交易</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2、实现百万级用户注册</span><br />\r\n<div style="background-color:#ffffff;margin:0px;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">\r\n 3、实现线下与大型汽车商、房地产开发商互动营销，推动大中商品线上交易<br />\r\n4、实现业务收入1500万元以上，网上交易额实现2亿以上<br />\r\n5、基于实际用户数量，合理拓展众筹及其他模式的运营<br />\r\n<img style="width:803px;height:371px;" alt="" src="http://www.dajiatou.com/uploadfile/2014/1220/20141220055821706.png" /> \r\n</div>";s:11:"do_describe";s:859:"<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">1、建立产品开发部，深度与品牌商家合作，有效利用资源整合，针对用户需求合理上架新品类商品，举例：品牌汽车、知名房地产楼盘</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">2、利用强大的后台用户数据分析系统能让运营期间精准分析用户需求，留住老用户，合理发掘新用户及营销方案，提高转化率</span><br />\r\n<span style="line-height:33px;background-color:#ffffff;font-family:''Microsoft Yahei'', SimHei;color:#333333;font-size:16px;">3、加强技术核心，建立健全的独立财务系统，为后期资本运作打造坚实的基底。</span>";s:9:"is_income";s:1:"1";s:11:"item_income";s:7:"3000000";s:6:"is_out";s:1:"1";s:8:"item_out";s:1:"0";s:10:"income_num";i:2;s:7:"out_num";i:1;}s:6:"income";a:1:{i:1;a:3:{s:4:"type";s:12:"广告收入";s:5:"money";s:7:"3000000";s:4:"memo";s:0:"";}}s:3:"out";a:0:{}}}', 'a:0:{}', 0, 2, 1325577600, 12, 1, 0, '茂名景森网络通讯科技有限公司', '广东省茂名市茂南区新福二路18号', 0, 0, '【项目估值1000万，融资金额200万，出让比例50%】1元团（www.1ytuan.com）使用目前流行的一种新型的网购模式——众筹，只需1元就有可能买到一件商品。1元团把一件商品平分成若干“等份”出售，每份1元，每一元为一个随机团码，当一件商品所有“等份”售出后，根据第三方股市数据，计算出一名幸运团码，拥有该幸运团码者即可获得此商品。本项目采用全新互联网商品众筹模式，推翻传统电商单一销售方式，降低了用户对传统电商商品售价的门槛，独特的线下与线上营销结合，成为本项目的运营核心，全新的电商模式能快速吸引消费群体及让入驻的商品体现最有效的广告价值。', 1435429124, 1, 0.00, 50.00, 0, 0.00, 1, 1, 2000000.00, 2, 100000.00, '', 'a:7:{s:8:"legal_id";a:3:{s:6:"status";s:1:"1";s:6:"reason";s:0:"";s:12:"display_type";s:1:"1";}s:12:"legal_credit";a:3:{s:6:"status";s:1:"1";s:6:"reason";s:0:"";s:12:"display_type";s:1:"1";}s:16:"business_license";a:3:{s:6:"status";s:1:"0";s:6:"reason";s:0:"";s:12:"display_type";s:1:"0";}s:28:"ta