(32, 58, 3000.00, 1, 3000.00, '爱的礼物：精美工艺品及红酒及晚餐。如果你希望得到一份爱的礼物与记念，请留言你的详细地址姓名电话，我将会于爱天使重建之后的三个月内为你寄一件精美的工艺品及价值688元的澳洲康纳瓦拉红酒一瓶及邀请你到爱天使享受晚餐！你将成为爱天使的终生会员。。。', 1, 0.00, 0, 0, 50, 0),
(42, 63, 100.00, 4, 400.00, '', 1, 0.00, 0, 0, 30, 5),
(34, 63, 1.00, 2, 2.00, '幸运支持者，一元抽取追踪儿童智能手环\r\n\r\n感谢您的支持，我们将会在众筹结束当天，在参与1元奉献的支持者中，抽取2位幸运支持者，2位幸运支持者将获得台湾正品追踪儿童智能手环。支持1元也要留下联系方式哦，以便我们后期联系上您。祝您好运。', 0, 0.00, 0, 0, 30, 3),
(35, 64, 99.00, 10, 990.00, 'Butterfly A套餐 惊喜价\r\n\r\nButterfly A套餐一组。惊喜价99元，限量20组。拍下后请备注颜色，不备注默认发白色。众筹需周期，敬请理解。承诺众筹价格远低于市场零售价。', 1, 3.00, 0, 0, 30, 5),
