(37, 65, 222.00, 1, 222.00, '众筹成功后，您将优先获得MiniO产品一台！\r\n\r\n预计产品上市后零售价在1900元左右，众筹期间，每一位支持我们的朋友都将获得一台MiniO 产品，并享受超长售后服务。', 1, 10.00, 1, 15, 30, 5),
