(39, 70, 50.00, 20, 1000.00, '《匆匆那年》见面礼2\r\n\r\n1、 搜狐VIP季卡：可享受搜狐视频VIP会员服务及VIP特权：全站无广告（除少量美剧）、尊贵会员身份、享用高速通道；2、“乔燃”扮演者白敬亭 亲笔签名照（主演随机签名，以实物为准）； 3、“赵烨”扮演者杜维瀚 亲笔签名照（主演随机签名，以实物为准）。', 0, 0.00, 0, 0, 0, 0),
(43, 73, 100.00, 5, 500.00, 'Power Up 3.0 全球首款可以遥控纸飞机\r\n\r\n此项是为了感谢 所有poweup3.0 狂热支持者 我们完全不计任何成本 做推广 （原价498元）我们将会在众筹结束后30天以内将本产品派发完毕。并提供3个月质保 尽管硬件成本，运营成本更加高昂，我们坚持让我们的用户获得最好的服务，拥有更美好的体验 换您一个童年的梦想', 1, 0.00, 1, 5, 30, 0),
(44, 73, 500.00, 11, 5500.00, '429元抢先体验Power Up 3.0遥控纸飞机\r\n\r\n为了感谢您对Power Up 3.0遥控纸飞机的支持 众筹数量达到110以后 每一位支持我们的的用户我们都将额外赠送价值由创意文化提供的小黄鸭手机支架一个 非常感谢您的热情支持 我们将会在众筹结束后30天以内将本产品派发完毕。并提供3个月质保 尽管硬件成本，运营成本更加高昂，我们坚持让我们的用户获得最好的服务，拥有更美好的体验 换您一个童年的梦想', 1, 5.00, 1, 50, 30, 0),
