INSERT INTO `%DB_PREFIX%msg_template` (`id`, `name`, `content`, `type`, `is_html`) VALUES
(1, 'TPL_MAIL_USER_PASSWORD', '<table cellpadding="0" cellspacing="0" bgcolor="" width="100%" style="background:#ffffff;" class="baidu_pass">\r\n<tbody>\r\n  <tr>\r\n    <td>\r\n    <table cellpadding="0" cellspacing="0" width="100%">\r\n        <tbody>\r\n   <tr>\r\n      <td style="background:#ffffff;border-bottom:2px solid #dfdfdf;width:15px;">&nbsp;</td>\r\n      <td style="background:#ffffff;border-bottom:2px solid #ffffff;width:10px;">&nbsp;</td>\r\n      <td style="background:#ffffff;width:137px;"><img src="{$user.logo}" class="logo" ellpadding="0" cellspacing="0"></td>\r\n     <td style="background:#ffffff;border-bottom:2px solid #ffffff;width:10px;">&nbsp;</td>\r\n      <td style="background:#ffffff;border-bottom:2px solid #dfdfdf;">&nbsp;</td>\r\n   </tr>\r\n        </tbody>\r\n   </table>\r\n    </td>\r\n </tr>\r\n <tr>\r\n    <td>\r\n    <table cellpadding="0" cellspacing="0" width="100%">\r\n        <tbody>\r\n   <tr>\r\n      <td width="25px;" style="width:25px;"></td>\r\n     <td align="">\r\n       <div style="line-height:40px;height:40px;"></div>\r\n       <p style="margin:0px;padding:0px;"><strong style="font-size:14px;line-height:24px;color:#333333;font-family:arial,sans-serif;">亲爱的用户：</strong></p>\r\n        <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:''宋体'',arial,sans-serif;">{$user.user_name}你好，请点击以下链接修改您的密码：</p>\r\n       <p style="margin:0px;padding:0px;"><a href="{$user.password_url}" style="line-height:24px;font-size:12px;font-family:arial,sans-serif;color:#0000cc" target="_blank">{$user.password_url}</a></p>\r\n       <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#979797;font-family:arial,sans-serif;">(如果您无法点击此链接，请将它复制到浏览器地址栏后访问)</p>\r\n        <div style="line-height:80px;height:80px;"></div>\r\n       <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:''宋体'',arial,sans-serif;">{$user.site_name}团队</p>\r\n        <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:''宋体'',arial,sans-serif;"><span style="border-bottom:1px dashed #ccc;" t="5" times="">{$user.send_time}</span></p>\r\n     </td>\r\n   </tr>\r\n   </tbody>\r\n    </table>\r\n    </td>\r\n </tr>\r\n \r\n</tbody>\r\n</table>', 1, 1),
(3, 'TPL_MAIL_USER_VERIFY', '<table cellpadding="0" cellspacing="0" bgcolor="" width="100%" style="background:#ffffff;" class="baidu_pass">\r\n<tbody>\r\n  <tr>\r\n    <td>\r\n    <table cellpadding="0" cellspacing="0" width="100%">\r\n        <tbody>\r\n   <tr>\r\n      <td style="background:#ffffff;border-bottom:2px solid #dfdfdf;width:15px;">&nbsp;</td>\r\n      <td style="background:#ffffff;border-bottom:2px solid #ffffff;width:10px;">&nbsp;</td>\r\n      <td style="background:#ffffff;width:137px;"><img src="{$user.logo}" class="logo" ellpadding="0" cellspacing="0"></td>\r\n     <td style="background:#ffffff;border-bottom:2px solid #ffffff;width:10px;">&nbsp;</td>\r\n      <td style="background:#ffffff;border-bottom:2px solid #dfdfdf;">&nbsp;</td>\r\n   </tr>\r\n        </tbody>\r\n   </table>\r\n    </td>\r\n </tr>\r\n <tr>\r\n    <td>\r\n    <table cellpadding="0" cellspacing="0" width="100%">\r\n        <tbody>\r\n   <tr>\r\n      <td width="25px;" style="width:25px;"></td>\r\n     <td align="">\r\n       <div style="line-height:40px;height:40px;"></div>\r\n       <p style="margin:0px;padding:0px;"><strong style="font-size:14px;line-height:24px;color:#333333;font-family:arial,sans-serif;">亲爱的用户：</strong></p>\r\n        <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:''宋体'',arial,sans-serif;">您好！</p>\r\n        <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:''宋体'',arial,sans-serif;">您于 {$user.send_time_ms} 帐号 发送验证码：</p>\r\n        <p style="margin:0px;padding:0px;">验证码：{$user.send_code}</p>\r\n         \r\n       <div style="line-height:80px;height:80px;"></div>\r\n       <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:''宋体'',arial,sans-serif;">{$user.site_name}帐号团队</p>\r\n        <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:''宋体'',arial,sans-serif;"><span style="border-bottom:1px dashed #ccc;" t="5" times="">{$user.send_time}</span></p>\r\n     </td>\r\n   </tr>\r\n   </tbody>\r\n    </table>\r\n    </td>\r\n </tr>\r\n <tr>\r\n    <td>\r\n      <table cellpadding="0" cellspacing="0" width="100%" style="border-top:1px solid #dfdfdf">\r\n     <tbody>\r\n     <tr>\r\n        <td width="25px;" style="width:25px;"></td>\r\n       <td align="">\r\n         <div style="line-height:40px;height:40px;"></div>\r\n         <p style="margin:0px;padding:0px;line-height:24px;font-size:12px;color:#979797;font-family:''宋体'',arial,sans-serif;">若您没有注册过{$user.site_name}帐号，请忽略此邮件，此帐号将不会被激活，由此给您带来的不便请谅解。</p>\r\n        </td>\r\n     </tr>\r\n     </tbody>\r\n      </table>\r\n    </td>\r\n </tr>\r\n</tbody>\r\n</table>', 1, 1),
